import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Dashboard() {
  const [expenses, setExpenses] = useState([]);
  const [editingExpense, setEditingExpense] = useState(null);

  useEffect(() => {
    fetchExpenses();
  }, []);

  const fetchExpenses = () => {
    axios.get('http://localhost:5000/view_expenses')
    .then(response => {
      setExpenses(response.data);
    })
    .catch(error => {
      console.error("There was an error fetching the expenses!", error);
    });
  };

  const handleEditingChange = (e) => {
    setEditingExpense({
      ...editingExpense,
      [e.target.name]: e.target.value
    });
  };

  const handleEditSubmit = (e) => {
    e.preventDefault();
    const { id, ...updateData } = editingExpense;
    axios.post(`http://localhost:5000/edit_expense/${id}`, updateData)
    .then(response => {
      fetchExpenses();
      setEditingExpense(null);
    })
    .catch(error => {
      console.error("There was an error editing the expense!", error);
    });
  };

  const handleDelete = (id) => {
    axios.post(`http://localhost:5000/remove_expense/${id}`)
    .then(response => {
      fetchExpenses();
    })
    .catch(error => {
      console.error("There was an error deleting the expense!", error);
    });
  };

  const startEditing = (expense) => {
    setEditingExpense(expense);
  };

  return (
    <div>
      <h1>Your Expenses</h1>

      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>Description</th>
            <th>Amount</th>
            <th>Method</th>
            <th>Category</th>
            <th>Type</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {expenses.map(expense => (
            <tr key={expense.id}>
              <td>{expense.date}</td>
              <td>{expense.descr}</td>
              <td>{expense.amount}</td>
              <td>{expense.method}</td>
              <td>{expense.category}</td>
              <td>{expense.type}</td>
              <td>
                <button onclick={() => startEditing(expense)}>Edit</button>
                <button onclick={() => handleDelete(expense.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

    {editingExpense && (
      <form onSubmit={handleEditSubmit}>
        <h2>Edit Expense</h2>
        <label>
          Date:
          <input type="date" name="date" value={editingExpense.date} onChange={handleEditChange} required />
        </label>
        <label>
          Description:
          <input type="text" name="descr" value={editingExpense.descr} onChange={handleEditChange} required />
        </label>
        <label>
          Amount:
          <input type="number" name="amount" value={editingExpense.amount} onChange={handleEditChange} required />
        </label>
        <label>
          Method:
          <input type="text" name="method" value={editingExpense.method} onChange={handleEditChange} required />
        </label>
        <label>
          Category:
          <input type="text" name="category" value={editingExpense.category} onChange={handleEditChange} required />
        </label>
        <label>
          Type:
          <input type="text" name="type" value={editingExpense.type} onChange={handleEditChange} required />
        </label>
        <button type="submit">Save Changes</button>
        <button onClick={() => setEditingExpense(null)}>Cancel</button>
      </form>
    )}
    </div>
  );
}

export default Dashboard;
